numbers = list(array.split(' '))
ctr = 1

def sort_on_weight(number1, number2):
    start_index = ctr*5
    end_index = (ctr-1)*5

    start1 = len(number1) - start_index
    end1 = len(number1) - end_index

    if(start1<0): start1=0
    if(end1<0): end1=0

    start2 = len(number2) - start_index
    end2 = len(number2) - end_index

    if(start2<0): start2=0
    if(end2<0): end2=0

    a = number1[start1:end1]
    b = number2[start2:end2]

    if (a == ""): a="0"
    if (b == ""): b="0"

    return int(a) - int(b)

